import { BrowserRouter, Route, Routes } from "react-router-dom";
import {Work} from "./pages/Work";
function App() {
  return (
    <>
    <header>
      <a href="/">home</a>
      <a href="/work">Work</a>
    </header>
  <Routes>
    <Route path="/work" element={<Work />} />


  </Routes> 
  </>
  );
}

export default App;
